    </button>
    <div class="dropdown-content">
      <a href="#">Link 1</a>
      <a href="#">Link 2</a>
      <a href="#">Link 3</a>
    </div>
  </div> 
</div>

    </div>
       <h1 className='heading_style'> Netflix</h1>

    <Card  imgsrc={data[0].imgsrc}
    title={data[0].title}
    name={data[0].name}
    links={data[0].links}/>
    <Card  imgsrc={data[1].imgsrc}
    title={data[1].title}
    name={data[1].name}
    links={data[1].links}/>
    <Card  imgsrc={data[2].imgsrc}
